; // Import EnchereService\n\n@Component({\n  selector: 'app-article-tendance',\n  templateUrl: './article-tendance.component.html',\n  styleUrls: ['./article-tendance.component.css'] // Fixed the property name from styleUrl to styleUrls\n})\nexport class ArticleTendanceComponent implements OnInit {\n  showSubCategories: boolean = false;\n  selectedCategory: Categorie | null = null;\n  categoryName: string = '';\n  subCategories: SousCategorie[] = [];\n  filteredSousCategories: SousCategorie[] = [];\n  categories: Categorie[] = [];\n  selectedSousCategorie: SousCategorie | null = null;\n  enchereDataTendance: Enchere[] = []; // Array to hold auction data\n\n  constructor(private dataService: CategorieService, private enchereService: EnchereService) { }\n\n  ngOnInit(): void {\n    this.getCategories();\n    this.getEnchereTendance(); // Call to fetch trending auction data\n  }\n\n  getCategories(): void {\n    this.dataService.getAllCategories().subscribe((categories: Categorie[]) => {\n      this.categories = categories;\n    });\n  }\n\n  toggleSubCategories(category: Categorie): void {\n    if (this.selectedCategory === category) {\n      this.showSubCategories = !this.showSubCategories;\n    } else {\n      this.selectedCategory = category;\n      this.showSubCategories = true;\n      this.categoryName = category.nom;\n      this.getSousCategories(category.id_categorie);\n    }\n  }\n\n  getSousCategories(categoryId: number): void {\n    this.dataService.getSubCategoriesByCategoryId(categoryId).subscribe(subCategories => {\n      this.subCategories = subCategories;\n      this.filteredSousCategories = subCategories;\n      console.log('Filtered SubCategories:', this.filteredSousCategories);\n    });\n  }\n\n  getCategoryNameById(categoryId: number): void {\n    this.dataService.getCategoryById(categoryId).subscribe(category => {\n      this.categoryName = category.nom;\n      console.log('Category Name:', this.categoryName);\n    });\n  }\n\n  selectSubCategory(subCategory: SousCategorie): void {\n    this.selectedSousCategorie = subCategory;\n    this.getCategoryNameById(subCategory.id_categorie);\n  }\n\n  getEnchereTendance(): void {\n    this.enchereService.getEnchereTendance().subscribe(\n      (data: Enchere[]) => {\n        console.log('Enchere Tendance Data:', data);  // Log data to verify structure\n        this.enchereDataTendance = data;\n      },\n      (error) => {\n        console.error('Error fetching auction data:', error);\n      }\n    );\n  }\n}\n\n    \n\n    \n        \n  Articles Tendance\n\n  \n    \n      {{ category.nom }}\n    \n  \n\n  \n    Sous-catgories de {{ categoryName }}\n    \n      {{ subCategory.nom }}\n    \n  \n\n  \n    Enchres Tendance\n    \n      \n      \n        {{ enchere.nom }}\n        {{ enchere.description }}\n        Prix de dpart : {{ enchere.prixdepart | currency }}\n        Prix actuel : {{ enchere.prixactuel | currency }}\n        Nombre d'enchres : {{ enchere.NumBids }}\n      \n    \n  \n\n\n    \n\n    \n                \n                    ./article-tendance.component.css\n                \n                .container {\n  max-width: 1200px;\n  margin: 0 auto;\n  padding: 20px;\n  font-family: 'Roboto', sans-serif;\n  background-color: #f4f4f9;\n}\n\n.title {\n  text-align: center;\n  margin-bottom: 40px;\n  color: #333;\n  font-size: 2.5em;\n  font-weight: 600;\n}\n\n.category-container, .subcategory-container, .trending-auctions {\n  margin-bottom: 40px;\n}\n\n.category-container, .subcategory-container {\n  display: flex;\n  flex-wrap: wrap;\n  gap: 15px;\n  justify-content: center;\n}\n\n.category-card, .subcategory-card {\n  background-color: #ffffff;\n  border: 1px solid #e0e0e0;\n  border-radius: 10px;\n  padding: 20px;\n  cursor: pointer;\n  transition: background-color 0.3s, transform 0.2s, box-shadow 0.3s;\n  text-align: center;\n  width: 200px;\n  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);\n}\n\n.category-card:hover, .subcategory-card:hover {\n  background-color: #f0f0f0;\n  transform: translateY(-5px);\n}\n\n.category-card.active, .subcategory-card.selected {\n  background-color: #007bff;\n  color: #ffffff;\n}\n\n.trending-auctions h3 {\n  text-align: center;\n  margin-bottom: 20px;\n  color: #333;\n  font-size: 2em;\n  font-weight: 500;\n}\n\n.auction-card {\n  display: flex;\n  align-items: center;\n  background-color: #ffffff;\n  border: 1px solid #e0e0e0;\n  border-radius: 10px;\n  padding: 15px;\n  margin-bottom: 20px;\n  transition: box-shadow 0.3s;\n}\n\n.auction-card:hover {\n  box-shadow: 0 6px 12px rgba(0, 0, 0, 0.1);\n}\n\n.auction-image {\n  width: 120px;\n  height: 80px;\n  border-radius: 8px;\n  margin-right: 15px;\n  object-fit: cover;\n}\n\n.auction-details {\n  flex: 1;\n}\n\n.auction-details h4 {\n  margin: 0 0 10px;\n  color: #333;\n}\n\n.auction-details p {\n  margin: 5px 0;\n  color: #666;\n  line-height: 1.5;\n}\n\n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '  Articles Tendance            {{ category.nom }}            Sous-catgories de {{ categoryName }}          {{ subCategory.nom }}            Enchres Tendance                        {{ enchere.nom }}        {{ enchere.description }}        Prix de dpart : {{ enchere.prixdepart | currency }}        Prix actuel : {{ enchere.prixactuel | currency }}        Nombre d\\'enchres : {{ enchere.NumBids }}            '\n    var COMPONENTS = [{'name': 'AdminComponent', 'selector': 'app-admin'},{'name': 'AideComponent', 'selector': 'app-aide'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'ArticleTendanceComponent', 'selector': 'app-article-tendance'},{'name': 'CatgoriePageComponent', 'selector': 'app-catgorie-page'},{'name': 'ChatroomComponent', 'se